tinymce.PluginManager.add("image_upload",function(n){function t(){$("#html-editor-image-insert").val("");$("#element-html-editor-insert .preview-wrapper").empty();$("#element-html-editor-insert .progress-bar").width(0);$("#tinymce-image-upload").modal("show");selectedTinyMce=n}n.addButton("image_upload",{icon:"image",tooltip:"Image Upload",onclick:t});n.addMenuItem("image_upload",{icon:"image",text:"Image Upload",context:"insert",onclick:t})});